#290: Unexpected exception when class implements more methods than declared by a protocol

Given the following protocol:

@protocol TestProtocol
-(id)myMethod;
@end

The following code would raise an exception:

class MyClass (NSObject):
   __pyobjc_protocols__ = [objc.protocolNamed("TestProtocol")]

   def myMethod(self): return 1
   def otherMethod(self): return 2

Fixes #290

Issue #298: Odd type encoding for typedef alias

With some compilers the following code results
in a type encoding of "^{NSObject=#}" instead
of "@":

  typedef NSObject<NSObject> ObjectClass;
  ...
  @property ObjectClass* parent;
  ...

Closes #298
